          (artist) => artist.name === dayArtistEntry.artist
        );
        if (dayArtist) {
          lastSixDaysArtists.push(dayArtist);
          lastSixDaysDates.push(previousDay);
        }
      }
    }
  lastSixDaysArtists.reverse();
  lastSixDaysDates.reverse();

  function nextRewind() {
    if (rewindIndex == 5) {
      return
    }
    rewindIndex++;

    mysteryArtist = lastSixDaysArtists[rewindIndex];
    mysteryArtistEntry = {
      image_uri: mysteryArtist.image_uri,
      song_uri: mysteryArtist.song_uri,
      artist: mysteryArtist.name,
    };
    tempGuesses = [];
    tempGameOver = false;
    guessCount = 0;
  }

  function previousRewind() {
    if (rewindIndex == 0) {
      return
    }
    rewindIndex--;

    mysteryArtist = lastSixDaysArtists[rewindIndex];
    mysteryArtistEntry = {
      image_uri: mysteryArtist.image_uri,
      song_uri: mysteryArtist.song_uri,
      artist: mysteryArtist.name,
    };
    tempGuesses = [];
    tempGameOver = false;
    guessCount = 0;

    mysteryArtist = lastSixDaysArtists[rewindIndex];
    mysteryArtistEntry = {
      image_uri: mysteryArtist.image_uri,
      song_uri: mysteryArtist.song_uri,
      artist: mysteryArtist.name,
    };
    tempGuesses = [];
    guessCount = 0;
  }

  function playRewind() {
    playingGame = true;
    splashScreen = false;
    playingRewind = true;
    playingChallenge = false;
    normalGame = false;
    playingRush = false;

    if (browser) {
        gtag('event', 'rewind', {
        });
