          {/if}
          <p></p>
          <!-- <button class="learn-btn" on:click={toggleHelp}> -->
            <p class="learn-btn" on:click={toggleHelp}>How to Play</p>
          <!-- </button> -->
          <p></p>
          <div
            class="yesterdays-artist {isHovered ? 'hovered' : ''}"
            on:mouseover={() => (isHovered = true)}
            on:mouseout={() => (isHovered = false)}
          >
            <img
              class="artist-image"
              src={isHovered ? yesterdaysArtist.image_uri : "resources/cd.png"}
              alt="Artist Image"
            />
            <p class="artist-name">
              {isHovered ? yesterdaysArtist.name : "yesterday's"}
            </p>
          </div>
          <div class="module-list">
            <h2 class="module-list-header">Need more Spotle?</h2>
            <div class="module" on:click={handleCreate}>
              <div class="module-header">Create Game</div>
              <div
                class="module-image"
                style="background-image: url(resources/create.png)"
              >
                <div class="module-icon">
                  <Icon width={"1.75rem"} height={"1.75rem"} name={"create"}
                  ></Icon>
                </div>
                <button class="styled-btn module-btn">Create</button>
              </div>
              <div class="module-description">
                <p>Create your own Spotle and send it to your friends!</p>
              </div>
            </div>

            <div class="module" on:click={playRewind}>
              <div
                class="module-image"
                style="background-image: url(resources/rewind.png)"
              >
                <div class="module-header">Spotle Rewind</div>
                <div class="module-icon">
                  <Icon width={"1.75rem"} height={"1.75rem"} name={"rewind"}
                  ></Icon>
                </div>
                <button class="styled-btn module-btn">Play</button>
              </div>
              <div class="module-description">
                <p>Missed a few days? Rewind and play the last week.</p>
              </div>
            </div>
          </div>

          <div class="module-list">
            <h2 class="module-list-header">Play our new game!</h2>
            <div class="module">
              <a
                class="harmonies-link"
                href="https://harmonies.io"
                target="_blank"
              >
                <div
                  class="module-image-harmonies"
                  style="background-image: url(/resources/harmonies.png)"
                ></div>
                <div class="module-description">
                  <div class="module-text-content">
                    <h2>Harmonies</h2>
                    <p>The music connections game!</p>
                  </div>
                  <button class="styled-btn harmonies-module-btn">
                    Play
                  </button>
                </div>
              </a>
            </div>
          </div>

          <div class="ad-space"></div>
          <!-- <p></p>
          <button class="styled-btn coming-soon">
            SPOTLE REWIND (coming soon)
          </button>
          <button class="styled-btn" on:click={playRush}>SPOTLE JAM</button> -->
        </div>
      {/if}

      {#if playingGame}
        {#if playingRush}
          <Countdown></Countdown>
        {/if}
        <div
          class="game-container"
          style={showResults ? "filter: blur(3px)" : ""}
        >
          <div class="game-info-container">
            {#if playingRush}
              <div class="solved-spotles">
                Solved Spotles: {rushIndex}
              </div>
            {/if}
            <div class="guesses-remaining">
              {#if normalGame || playingChallenge || playingRewind}
                {#if guessCount == 10}
                  Guess 10 of 10
                {:else}
                  Guess {guessCount + 1} of 10
                {/if}
              {/if}
              {#if createGame}
                <div class="create-game-text">
                  <p>1.</p>
                  <h3>Pick an artist for your friend to guess.</h3>
                </div>
              {/if}
              {#if playingRush}
                Guess {guessCount + 1} of 30
              {/if}
            </div>
          </div>

          {#if playingRewind}
          <div class="rewind-btn-container">
            <button
                class="previous-btn"
                on:click={previousRewind}
                >
                <Icon width={".85rem"} height={".85rem"} name={"previous"}></Icon>
            </button>
            <div class="rewind-date">
              {lastSixDaysDates[rewindIndex]}
            </div>
            <button
                class="next-btn"
                on:click={nextRewind}
                >
                <Icon width={".85rem"} height={".85rem"} name={"next"}></Icon>
            </button>
          </div>
          {/if}

          <div class="search-container">
            {#if normalGame}
              <input
                type="text"
                name="search"
                id="search"
                placeholder="Type a guess here..."
                autocomplete="off"
                disabled={$gameOver}
                bind:value={searchTerm}
                on:keydown={(e) => {
                  if (e.key === "Enter")
                    handleSearch(filteredArtists[0], createGame);
                }}
              />
            {:else}
              <input
                type="text"
                name="search"
                id="search"
                placeholder="Type a guess here..."
                autocomplete="off"
                bind:value={searchTerm}
                on:keydown={(e) => {
                  if (e.key === "Enter")
                    handleSearch(filteredArtists[0], createGame);
                }}
              />
            {/if}
            <button
              class="guess-btn"
              on:click={() => handleSearch(filteredArtists[0], createGame)}
              ><i class="fa fa-search fa-lg"></i></button
            >
            <ul
              class="results"
              style="display: {filteredArtists.length > 0 ? 'block' : 'none'}"
            >
              {#each filteredArtists as artist}
                <li on:click={() => handleSearch(artist, createGame)}>
                  {artist}
                </li>
              {/each}
            </ul>
          </div>
          {#if normalGame && $guesses.length == 0}
            <p class="in-game-text">Guess the artist of the day.</p>
            <p class="in-game-text">
              Search for an artist to make your first guess.
            </p>
          {/if}
          {#if playingChallenge && tempGuesses.length == 0 && challengeNote != ""}
            <p class="in-game-text">
              A hint from your friend: {challengeNote}
            </p>
          {/if}
          {#if !createGame}
            <div class="guess-container">
              {#if normalGame}
                {#each [...$guesses].reverse() as guess (guess.name)}
                  <Guess artist={guess} {mysteryArtist}></Guess>
                {/each}
              {:else}
                {#each [...tempGuesses].reverse() as guess (guess.name)}
                  <Guess artist={guess} {mysteryArtist}></Guess>
                {/each}
              {/if}
            </div>
            {#if normalGame && $guesses.length == 1 && !$gameOver}
              <p class="in-game-text">
                Use the matching attributes to make more guesses. Good luck!
              </p>
            {/if}
